(1, 3, 1, 22, 1, 'Bootcamp Ruby on Rails', 'bootcamp-ruby-on-rails', 'Belajar menjadi Ruby on Rails Developer dalam 3 bulan dengan jaminan kerja dan magang di perusahaan ternama.', '/assets/source/bootcamp/bootcamp-1/promo/ruby-on-rails.jpg', '500000', '/assets/source/bootcamp/bootcamp-1/cover/simplescreenrecorder-2019-02-16_14.59.08.mp4', '  Bootcamp yang membantu Anda menjadi seorang Ruby Developer dalam 3 bulan dengan kesempatan magang dan berkarir.', '/assets/source/bootcamp/bootcamp-1/picture_problem/61-lessonproxmox5-0_copy.jpg', '          test problem', '/assets/source/bootcamp/bootcamp-1/picture_alasan/simplescreenrecorder-2019-02-16_14.59.08.mp4', 'target audience', 'punya laptop', '2019-01-31 13:46:44', '2019-04-15 13:53:46', '          test ikut bootcamp', '/assets/source/bootcamp/bootcamp-1/picture_desk/simplescreenrecorder-2019-02-16_14.59.08.mp4', 'https://google.com', '700000'),
(2, 3, 1, 22, 1, 'Become a Python Programmer', 'become-a-python-programmer', 'Menjadi seorang Python programmer', '/assets/source/bootcamp/bootcamp-2/promo/pythonfeatured.jpg', NULL, '/assets/source/bootcamp/bootcamp-2/cover/simplescreenrecorder-2018-10-28_16.17.41.mp4', 'Bootcamp yang membantu Anda menjadi seorang Python Developer dalam 3 bulan dengan kesempatan magang dan berkarir.', '/assets/source/bootcamp/bootcamp-2/picture_problem/36-lessonzimbraonlinecentos7.jpeg', '        test problem', '/assets/source/bootcamp/bootcamp-2/picture_alasan/simplescreenrecorder-2018-10-28_16.17.41.mp4', 'anak kecil', 'punya ibu', '2019-02-01 11:51:12', '2019-04-14 08:37:28', '        alasan bootcamp', '/assets/source/bootcamp/bootcamp-2/picture_desk/simplescreenrecorder-2018-10-28_16.17.41.mp4', 'https://facebook.com', '1200000'),
(3, 2, 1, 22, 1, 'Become a Data Scientist', 'become-a-data-scientist', 'Bootcamp Data Scientist terlengkap.', '/assets/source/bootcamp/bootcamp-3/promo/1_60gs-SFYyooZZBxatuoNJw.jpeg', '1000000', '/assets/source/bootcamp/bootcamp-3/cover/HOW TO POP SHOVE IT THE EASIEST WAY TUTORIAL - YouTube.MKV', '  Bootcamp yang membantu Anda menjadi seorang Data Scientist dalam 3 bulan dengan kesempatan magang dan berkarir.', '/assets/source/bootcamp/bootcamp-3/picture_problem/15-lessonsentoraubuntu1404.jpeg', '            tes coba jal untuk probelm', '/assets/source/bootcamp/bootcamp-3/picture_alasan/HOW TO POP SHOVE IT THE EASIEST WAY TUTORIAL - YouTube.MKV', 'Mahasiswa Teknik Informatika', 'Minimal punya basic komputer dan internet', '2019-02-16 05:33:35', '2019-04-14 08:47:15', '            coba jal untuk kenapa alasan belajar ini', '/assets/source/bootcamp/bootcamp-3/picture_desk/HOW TO POP SHOVE IT THE EASIEST WAY TUTORIAL - YouTube.MKV', 'https://drive.google.com/open?id=1RHNj7C1VjMGgpKYAJsFMAmsy946v_KleLUvYYiTunhQ', '1200000'),
(4, 3, 1, 22, 1, 'Become a Frontend Developer', 'become-a-frontend-developer', 'Menjadi seorang Frontend Developer', '/assets/source/bootcamp/bootcamp-4/promo/frontend.jpg', '56555', '/assets/source/bootcamp/bootcamp-4/cover/simplescreenrecorder-2019-02-16_14.59.08.mp4', 'Bootcamp yang membantu Anda menjadi seorang Frontend Developer dalam 3 bulan dengan kesempatan magang dan berkarir.', '/assets/source/bootcamp/bootcamp-4/picture_problem/23-lessonraid.jpeg', '      centos biru', '/assets/source/bootcamp/bootcamp-4/picture_alasan/simplescreenrecorder-2019-02-16_14.59.08.mp4', 'anak kecil', 'punya laptop', '2019-03-31 07:01:19', '2019-04-14 08:39:06', '      mtcna', '/assets/source/bootcamp/bootcamp-4/picture_desk/simplescreenrecorder-2019-02-16_14.59.08.mp4', 'https://evernote.com', '1200000'),
(5, 2, 1, 22, 1, 'Become an AI Engineer', 'become-an-ai-engineer', 'Bootcamp Menjadi AI Engineer', '/assets/source/bootcamp/bootcamp-5/promo/Slide1CoverArt.jpg', '234234', '/assets/source/bootcamp/bootcamp-5/cover/simplescreenrecorder-2019-02-16_15.14.20.mp4', 'Bootcamp yang membantu Anda menjadi seorang AI Engineer dalam 3 bulan dengan kesempatan magang dan berkarir.', '/assets/source/bootcamp/bootcamp-5/picture_problem/4-lessonserverubuntu1204.jpeg', '      setaetstsea', '/assets/source/bootcamp/bootcamp-5/picture_alasan/simplescreenrecorder-2019-02-16_15.14.20.mp4', 'Guru', 'Saya', '2019-03-31 07:10:29', '2019-04-14 08:38:38', '      steatesset', '/assets/source/bootcamp/bootcamp-5/picture_desk/simplescreenrecorder-2019-02-16_15.14.20.mp4', 'https://linuxku.com', '1300000'),
(6, 3, 1, 22, 1, 'Become a IOS Developer', 'become-a-ios-developer', 'Menjadi seorang IOS Developer', '/assets/source/bootcamp/bootcamp-6/promo/hello_world.png', '123456', '/assets/source/bootcamp/bootcamp-6/cover/simplescreenrecorder-2019-02-16_14.59.08.mp4', 'Bootcamp yang membantu Anda menjadi seorang IOS Developer dalam 3 bulan dengan kesempatan magang dan berkarir.', '/assets/source/bootcamp/bootcamp-6/picture_problem/35-lessonopenstack-devstack.jpeg', '      dgsgdfsd', '/assets/source/bootcamp/bootcamp-6/picture_alasan/simplescreenrecorder-2019-02-16_14.59.08.mp4', 'dgsgfsd', 'dgsgdsgfdss', '2019-03-31 07:15:47', '2019-04-14 08:36:10', '      dgsfgddf', '/assets/source/bootcamp/bootcamp-6/picture_desk/simplescreenrecorder-2019-02-16_14.59.08.mp4', 'https://cilsy.id', '1200000'),
(7, 2, 1, 22, 1, 'Demo - Become Data Scientist', 'demo-become-data-scientist', 'Bootcamp untuk membantu Anda Menjadi seorang Data Scientist Profesional dalam 3 bulan.', '/assets/source/bootcamp/bootcamp-7/promo/image3.jpg', '3900000', '/assets/source/bootcamp/bootcamp-7/cover/simplescreenrecorder-2019-02-16_15.14.20.mp4', 'Bootcamp Online Data Science Cilsy memberikan pengalaman belajar yang lebih pasti untuk Anda yang ingin memulai karir menjanjikan di bidang Data Science.\n\nProses belajar yang terstruktur berdasarkan kurikulum yang disusun langsung oleh praktisi Data Scientist akan membantu Anda lebih cepat memahami dan menguasai ilmu di bidang Data Science.', '/assets/source/bootcamp/bootcamp-7/picture_problem/image3.jpg', 'Data Scientist adalah profesi yang sangat dibutuhkan di era digital dan Big Data saat ini.\n\nSeorang Data Scientist berperan dalam mengolah dan menganalisa data untuk menunjang pengambilan keputusan penting dalam sebuah perusahaan. Data Science adalah sebuah bidang pekerjaan baru yang memiliki potensi sangat besar.', '/assets/source/bootcamp/bootcamp-7/picture_alasan/simplescreenrecorder-2019-02-16_15.14.20.mp4', 'Pemula', 'Memiliki basic Programming dan Matematika', '2019-04-29 04:35:20', '2019-04-30 06:40:22', 'Bootcamp Online Data Science dijalankan dengan serius. Kurikulum dan sistem belajar Bootcamp benar-benar di desain untuk meluluskan orang-orang yang berkemauan kuat dan mau terus belajar.\n\nTeknologi selalu berlari dan berlari. Jika Anda ingin menjadi seseorang yang memiliki skill spesialisasi dan daya saing di industri, maka Bootcamp ini adalah awal yang tepat untuk Anda memulai.', '/assets/source/bootcamp/bootcamp-7/picture_desk/simplescreenrecorder-2019-02-16_15.14.20.mp4', 'https://docs.google.com/document/d/1nY8QbSuuqz85PS4UebG_27corc5clQvbHErCvpLrFv0/edit?usp=sharing', '1200000');
