(17, 7, '24', 'Jawaban Anda belum tepat. Ini bukan nilai Mean yang tepat, bukan nilai Mean. Cek kembali rumus matematika atau command pyhton yang anda gunakan.', 2, NULL, NULL),
(18, 7, '28', 'Jawaban Anda belum tepat. Ini bukan nilai Mean yang tepat. Cek kembali rumus matematika atau command pyhton yang anda gunakan.', 2, NULL, NULL),
(19, 7, '30', 'Benar! Ini adalah nilai Mean. Rumusnya adalah Mean = nilai2 dari sekumpulan data/banyaknya data. Bisa menggunakan command python : \r\n\r\nmean_age = age.mean() \r\nprint(mean_age)\r\n\r\nDengan catatan :\r\nmean_age adalah nama variable untuk menyimpan nilai mean.\r\nage adalah kolom age pada file bioskop_dataset, yaitu sekumpulan data yang ingin kita cari nilai meannya.', 1, '2019-04-29 17:00:00', NULL),
(20, 8, 'Mean adalah teknik yang digunakan untuk mencari nilai rata-rata dari serangkaian data.', 'Jawaban Anda belum tepat. Karena ini termasuk pengertian Mean yang benar.', 2, NULL, NULL),
(21, 8, 'Mean = nilai2 dari sekumpulan data/banyaknya data', 'Jawaban Anda belum tepat. Karena ini termasuk rumus matematika yang benar untuk mendapatkan nilai Mean.', 2, NULL, NULL),
(22, 8, 'Mean bertujuan untuk mencari nilai terbanyak yang muncul dari serangkaian data.', 'Benar! Ini bukan tujuan dari Mean, melainkan tujuan dari Mode/Modus.', 1, '2019-04-29 17:00:00', NULL),
(23, 8, 'Mean = nilaidarisekumpulandata.mean()', 'Jawaban Anda belum tepat. Karena ini termasuk command python yang benar untuk mencari nilai Mean.', 2, '2019-04-29 17:00:00', NULL),
(24, 9, '24', 'Jawaban Anda belum tepat. Ini bukan nilai Mean yang tepat, bukan nilai Mean. Cek kembali rumus matematika atau command pyhton yang anda gunakan.', 2, '2019-04-22 17:00:00', '2019-04-22 17:00:00'),
(25, 9, '35', 'Jawaban Anda belum tepat. Ini bukan nilai Mean yang tepat. Cek kembali rumus matematika atau command pyhton yang anda gunakan.', 2, NULL, NULL),
(26, 9, '45', 'Jawaban Anda belum tepat. Ini bukan nilai Mean yang tepat. Cek kembali rumus matematika atau command pyhton yang anda gunakan.', 2, NULL, NULL),
(27, 9, '28', 'Benar! Ini adalah nilai Median. Rumusnya adalah Median = nilai tengah dari data yang sudah diurutkan. Bisa menggunakan command python : \r\n\r\nmedian_age = age.median() \r\nprint(median_age)\r\n\r\nDengan catatan :\r\nmedian_age adalah nama variable untuk menyimpan nilai median.\r\nage adalah kolom age pada file bioskop_dataset, yaitu sekumpulan data yang ingin kita cari nilai tengahnya/mediannya.', 1, '2019-04-29 17:00:00', NULL),
(28, 10, 'Dari data berikut : 9,4,5,6,9,4,5,6,7, nilai Mediannya adalah = 6.11.', 'Benar! Ini bukan hasil nilai Median, melainkan Mean. Mean adalah nilai rata-rata, cara mencarinya adalah dengan menjumlah seluruh data dibagi dengan banyaknya data. Mean = 9+4+5+6+9+4+5+6+7/9 = 6.11.', 1, NULL, NULL),
(29, 10, 'Median = nilaidarisekumpulandata.median()', 'Jawaban Anda belum tepat. Karena ini termasuk command python yang benar untuk mencari nilai Median.', 2, NULL, NULL),
(30, 10, 'Median adalah teknik yang digunakan untuk mencari nilai tengah dari serangkaian data.', 'Jawaban Anda belum tepat. Karena ini termasuk pengertian Median yang benar.', 2, '2019-04-29 17:00:00', NULL),
(31, 10, 'Dari data berikut : 1,9,4,5,6,7 nilai Mediannya adalah = 5.5.', 'Jawaban Anda belum tepat. Karena ini adalah nilai Mediannya. Cara mencarinya adalah dengan mengurutkan datanya terlebih dahulu menjadi 1,4,5,6,7,9. Lalu cari angka yang berada ditengah dari data tersebut, berhubung datanya berjumlah genap maka angka yang ada di urutan tengah adalah 5 dan 6. Nilai Median = 5+6 = 11/2 = 5.5', 2, '2019-04-29 17:00:00', NULL),
(32, 7, '45', 'Jawaban Anda belum tepat. Ini bukan nilai Mean yang tepat. Cek kembali rumus matematika atau command pyhton yang anda gunakan.\r\n', 2, '2019-04-29 17:00:00', NULL);
