(61, 22, 1, 'Belajar Inkscape untuk Pemula (Webinar)', 1, 'https://www.cilsy.id/assets/source/images/lesson/44-lessonwebinarinkscape.png', '<p>Ingin belajar bagaimana membuat desain-desain vektor sendiri? asiknya disini software yang digunakan benar-benar software gratis, yaitu Inkscape. Kalian akan mempelajari dasar-dasar inkscape mulai dari pengenalan pembuatan objek, ruler, export gambar, hingga belajar membuat karakter kartun sendiri. Materi ini adalah hasil rekaman webinar cilsy.</p>', 'belajar-inkscape-untuk-pemula-webinar', NULL, NULL, 0, 0, '2017-11-01 01:04:35', '2017-11-01 01:04:35', '', '', '', NULL),
