(71, 22, 1, 'Tutorial Rizal', 2, 'https://dev.cilsy.id/assets/source/MIKROTIK.png', '<p>test</p>', 'tutorial-rizal', '50000', 'test', 1, 0, '2018-05-31 06:40:55', '2018-07-06 10:16:27', '', '', '', NULL),
(72, 22, 1, 'tutorial rizal ganteng', 3, 'https://dev.cilsy.id/assets/source/lessons/DSC02249.JPG', 'Sebelum membeli, pernahkah Anda menjumpai daftar materi yang lebih lengkap dari paket di dalam Modul ini ? Saya rasa sangat sulit untuk menemukannya, dengan harga yang terjangkau. Kalaupun ada, biasanya berbahasa Inggris.\r\n\r\n\r\n\r\nDi modul ini Anda akan belajar melakukan caching update game online dan caching video Youtube serta menggabungkannya dengan Mikrotik. Dari hasil settingan, Anda dapat menghemat hingga 30% bandwidth dan mempercepat kecepatan internet Anda hingga 20%.\r\n\r\n\r\n\r\nLebih dari 230 Orang yang sudah pernah mempelajari Modul ini secara offline & online di Batch 1 dan 2, sudah merasakan manfaat HIT hingga mencapai 80 Mbps dapat mempercepat internet mereka !\r\n\r\n\r\n\r\nModul ini berisi eBook 133 halaman + 32 Video Tutorial komprehensif + Script konfigurasi siap pakai. Sehingga Anda tidak akan kebingungan saat praktek DARI NOL. Trainer profesional Cilsy pun siap membantu jika Anda kesulitan saat praktek. Anda bisa bertanya melalui fitur komentar.\r\n\r\n\r\n\r\nCARA PEMESANAN :\r\n\r\n\r\n\r\n- Klik tombol \"BELI\" diatas\r\n\r\n- Pilih metode pembayaran\r\n\r\n- Transfer sesuai nominal\r\n\r\n- Proses selesai\r\n\r\n\r\n\r\nTidak perlu konfirmasi pembayaran, akun Anda otomatis aktif. Anda sudah bisa mengakses seluruh materi dan mulai praktek.\r\n\r\n\r\n\r\nSetelah mempelajari Modul ini, Anda sudah siap mengimplementasikan ilmunya di kantor / bisnis Anda. Bahkan Anda juga bisa membuka lahan bisnis baru, yaitu jasa setting Mikrotik + Squid Proxy yang bernilai 2 - 4 Jutaan sekali setting.\r\n\r\n\r\n\r\nAda pertanyaan ? Hubungi kami melalui live chat di pojok kanan bawah.', 'tutorial-rizal-ganteng', '55000', NULL, 1, 0, '2018-07-06 09:47:10', '2018-07-06 09:47:10', '', '', '', NULL),
