(4, 1, 'webinarmikrotikvpn', 'halaman resmi webinar mikrotik vpn', 'Webinar GRATIS Membangun Site to Site VPN dengan Mikrotik', '<p style=\"text-align: center;\"><img src=\"https://3.bp.blogspot.com/-aV9Fd2V9N2w/WZebqxzs9zI/AAAAAAAAJlU/ogqnbWLTFvAW2Gab7FWYiotZfPAc2CALQCLcBGAs/s1600/Poster%2B-%2BMembangun%2BSite%2Bto%2BSite%2BVPN%2Bdengan%2BMikrotik%2BWebinar%2Bbaru.png\" alt=\"\" width=\"322\" height=\"322\" /></p>\r\n<p>Webinar ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet.</p>\r\n<p><span id=\"Registration1_lblCustomTextTop\">Rekan-rekan bisa hanya menonton saja webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :<br />1. RouterBoard yang ada Port USB (Rekomendasi RB951ui-2hnd)<br />2. Modem GSM + Internet <br />3. Laptop/ PC</span></p>\r\n<p>Webinar ini terdiri dari 2 sesi yang diselenggarakan pada :</p>\r\n<p>Sesi 1 : 20 Agustus 2017 pukul 20.00 - selesai</p>\r\n<p>Sesi 2 : 27 Agustus 2017 pukul 20.00 - selesai</p>\r\n<p>Untuk pendaftaran silahkan klik link berikut :</p>\r\n<p>Sesi 1 : <a href=\"http://bit.do/webinarcilsyvpn1\" target=\"_blank\" rel=\"noopener noreferrer\">PENDAFTARAN SESI 1</a></p>\r\n<p>Sesi 2 : <a href=\"http://bit.do/webinarcilsyvpn2\" target=\"_blank\" rel=\"noopener noreferrer\">PENDAFTARAN SESI 2</a></p>', 'webinar, mikrotik, jaringan, vpn', '2017-08-19 02:04:21', '2017-08-21 03:16:00'),
(5, 1, 'webinaraugmentedreality', 'halaman resmi webinar augmented reality', 'Webinar GRATIS Bikin Sendiri Aplikasi Augmented Reality', '<p style=\"text-align: center;\"><img src=\"https://4.bp.blogspot.com/-27f8bvk7w8w/WZebw9cbSBI/AAAAAAAAJlY/JmH9gQutSEcDwhNbwqkH0GMOGda3tOP2QCLcBGAs/s1600/Poster%2B-Bikin%2Bsendiri%2Baplikasi%2BAugmented%2BReality%2Bbaru.png\" width=\"322\" height=\"322\" /></p>\r\n<p>Webinar ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet.</p>\r\n<p><span id=\"Registration1_lblCustomTextTop\">Rekan-rekan bisa hanya menonton saja webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :<br />1. Unity3D (min versi 5)<br />2. Vuforia Unity Plugin<br />3. Android SDK (Min android 4)<br />4. Inkscape/Corel<br />5. Smartphone Android<br />6. Koneksi Internet<br /></span></p>\r\n<p>Webinar ini terdiri dari 2 sesi yang diselenggarakan pada :</p>\r\n<p>Sesi 1 : 23 Agustus 2017 pukul 20.00 - selesai</p>\r\n<p>Sesi 2 : 30 Agustus 2017 pukul 20.00 - selesai</p>\r\n<p>Untuk pendaftaran silahkan klik link berikut :</p>\r\n<p>Sesi 1 : <a href=\"http://bit.do/webinarcilsyar1\" target=\"_blank\" rel=\"noopener noreferrer\">PENDAFTARAN SESI 1</a></p>\r\n<p>Sesi 2 : <a href=\"http://bit.do/webinarcilsyar2\" target=\"_blank\" rel=\"noopener noreferrer\">PENDAFTARAN SESI 2</a></p>', 'ar, webinar, augmented reality', '2017-08-19 02:06:44', '2017-08-21 03:15:25'),
(6, 1, 'webinarcilsynextcloud', 'halaman resmi webinar nextcloud', 'Webinar GRATIS Install Nextcloud di Ubuntu 16.04 Server', '<p>Nextcloud adalah aplikasi untuk membuat sistem penyimpanan data cloud mirip Dropbox atau Google Drive. Jadi kita bisa bikin sendiri Dropbox/Google Drive pribadi. Di webinar ini, bersama kang Tresna Widyaman - Founder Warriormux dan Trainer di Cilsy rekan-rekan akan diajarkan bagaimana cara membuat Nextcloud di Ubuntu server. Webinar ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet.</p>\r\n<p><span id=\"Registration1_lblCustomTextTop\">Rekan-rekan bisa hanya menonton saja webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :<br />1. Virtualbox/VMware <br />2. ISO ubuntu 16.04 Server. <a href=\"https://www.ubuntu.com/download/server/thank-you?version=16.04.3&amp;architecture=amd64\" rel=\"nofollow\">UNDUH DISINI</a><br />3. Akses internet<br /></span></p>\r\n<p>Webinar ini diselenggarakan pada :</p>\r\n<p><strong>12 September 2017 pukul 20.00 - selesai</strong></p>\r\n<p style=\"text-align: left;\">Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"http://www.anymeeting.com/PIID=ED52DE88874831\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WEBINAR INSTALASI NEXTCLOUD DI UBUNTU 16.04 SERVER</a></h2>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>', 'webinar, server, ubuntu, linux, nextcloud', '2017-09-07 07:05:05', '2017-09-07 08:40:30'),
(7, 1, 'webinarcilsyinkscape', 'halaman resmi webinar inkscape', 'Webinar GRATIS Belajar Inkscape untuk Pemula', '<p>Materi ini akan membahas dasar-dasar cara menggunakan Inkscape sehingga rekan-rekan bisa setidaknya nanti menggantikan peran Corel Draw/Adobe Illustrator dengan aplikasi gratis ini. Webinar ini akan dibawakan oleh mas Tresna Widyaman juga - Founder Warriormux dan Trainer di Cilsy dan diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet.</p>\r\n<p><span id=\"Registration1_lblCustomTextTop\">Rekan-rekan bisa hanya menonton saja webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :<br />1. Sudah terinstall software Inkscape<br /></span></p>\r\n<p>Webinar ini diselenggarakan pada :</p>\r\n<p><strong>19 September 2017 pukul 20.00 - selesai</strong></p>\r\n<p style=\"text-align: left;\">Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"http://www.anymeeting.com/PIID=ED52DE88874830\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WEBINAR BELAJAR INKSCAPE UNTUK PEMULA</a></h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'webinar, inkscape, desain', '2017-09-07 07:14:56', '2017-09-07 08:13:00'),
(8, 1, 'kulgramcilsypaket', 'halaman resmi kulgram manajemen paket', 'Kulgram GRATIS Manajemen Paket di Ubuntu', '<p>Kulgram atau Kuliah di Telegram kali ini akan membahas tentang bagaimana dasar-dasar melakukan manajemen paket di Ubuntu. Mulai dari instalasi software, hapus software, dll. Kulgram ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet dan menginstall aplikasi Telegram. Yang akan menjadi pembicara adalah mas Ade Malsasa Akbar - Founder Teknoplasma dan Penulis di Linuxku.com</p>\r\n<p>Rekan-rekan bisa hanya duduk manis mengikuti kulgram ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :<br />1. Laptop harus sudah terinstall Ubuntu<br />2. Harus punya aplikasi Telegram<br /><br />Kulgram ini diselenggarakan pada :<br /><strong>9 September 2017 pukul 13.00 - selesai<br /></strong><br />Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><strong><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSeIwPN8t9k4FZGAqWnBjtQTiV88mODNnjT2f_0DKxgsN9Pg_Q/viewform?usp=sf_link\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR KULGRAM MANAJEMEN PAKET UBUNTU</a></strong></h2>\r\n<p style=\"text-align: center;\">&nbsp;</p>', 'kulgram, telegram, ubuntu, linux', '2017-09-07 07:35:15', '2017-09-07 08:09:11'),
(9, 1, 'workshopubuntu', 'halaman workshop command line di linux ubuntu server', 'Workshop GRATIS Command Line di Linux Ubuntu Server', '<p>Cilsy Big Event #4 kali ini akan membawakan workshop mengenai cara-cara melakukan command line di linux ubuntu server. Sangat cocok untuk kalian yang baru mau belajar Linux Server dan bingung apa maksud dari layar hitam putih yang sering kalian lihat itu. Bersama kang Fakhri Abdillah - Tutorial Creator di Cilsy, kalian akan diajarkan semuanya. Setelah ikut workshop ini, diharapkan nanti kalian sudah bisa ketak-ketik sendiri command-command di linux ubuntu server.</p>\r\n<p>Workshop ini diselenggarakan pada :</p>\r\n<div><strong>Hari, Tanggal : Sabtu, 23 September 2017</strong><br /><strong>Jam : 08.00 - 12.00</strong><br /><strong>Tempat : DiLo Bandung&nbsp;<span class=\"_Xbe\">Gedung Balemotekar, Jalan Banda No. 40, Citarum, Bandung</span></strong><br /><strong>Harga : FREE</strong></div>\r\n<p>Siapa saja kah yang bisa ikut? Semuanya bisa. Mulai dari mahasiswa, anak sekolahan, sampai para bapak-bapak pekerja IT pun silahkan ikut. Namun berhubung venue workshop ini terbatas, yang boleh ikut hanyalah orang-orang yang terpilih saja yang <strong>MENDAPAT BALASAN EMAIL</strong> dari <a href=\"mailto:event@cilsy.id\">event@cilsy.id</a> setelah kalian mendaftar.</p>\r\n<p>Kalian juga harus memiliki <strong>LAPTOP SENDIRI</strong> dan dibawah saat workshop. Tidak ada minimum spek pada laptop.</p>\r\n<p>Silahkan mendaftar melalui link formulir berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSc0WTAV6tWwyigwQmOnyQ-Z03bQ5TLuFPgRthpcc2hev1vNoA/viewform?usp=sf_link\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WORKSHOP COMMAND LINE</a></h2>\r\n<p>Setelah mendaftar silahkan tunggu max h-3 acara, kalian yang terpilih akan dikirim balasan email. Yang boleh datang ke workshop <strong>HANYA</strong> yang dapat balasan email.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'workshop, command line, linux, ubuntu', '2017-09-07 08:06:16', '2017-09-07 08:07:58'),
(10, 1, 'downloadebooknextcloud', 'halaman download ebook instalasi nextcloud', 'Download Ebook Tutorial Install Nextcloud di Ubuntu 16.04 Server', '<p>Untuk mendownload ebook Install Nextcloud di Ubuntu 16.04 Server, kalian tinggal lakukan hal ini ya :<br /><br />1. Silahkan tambahkan nomor whatsapp <strong>089630713487</strong> (Beri nama kontaknya bebas, boleh Cilsy saja). Jika kalian sudah pernah menambahkan nomor tersebut, boleh langsung lompat ke langkah dibawah.<br />2. Kirim pesan pribadi ke nomor whatsapp tersebut yang berisi : <strong>DOWNLOAD EBOOK NEXTCLOUD DI UBUNTU 16.04 SERVER</strong><br /><br />Nanti kalian akan dibalas oleh tim Cilsy link untuk mendownload ebooknya.<br /><br />Oiya, asiknya lagi kalian akan dapat bonus info-info penting dan menarik seputar dunia IT, jaringan, server hingga IoT tiap minggunya dari nomor tersebut lho. Link-link ebook, webinar, workshop dan tutorial-tutorial eksklusif juga bakal sering kita bagikan disana.<br /><br />Salam!</p>\r\n<p>&nbsp;</p>', 'ebook, download, linux, ubuntu, nextcloud', '2017-09-08 09:28:25', '2017-09-08 09:31:26'),
