(12, 1, 'kulgramcilsycwp', 'halaman resmi kulgram centos web panel', 'Kulgram GRATIS Membangun Server Hosting dengan Centos Web Panel', '<p>Kulgram atau Kuliah di Telegram kali ini akan membahas tentang bagaimanamembuat sendiri server Hosting menggunakan Centos Web Panel. Mulai dari instalasi Centos, install centos web panel, dll. Kulgram ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet dan menginstall aplikasi Telegram. Yang akan menjadi pembicara adalah mas Taufik Mulyana founder dari blog Nothinux.<br /><br />Rekan-rekan bisa hanya duduk manis mengikuti kulgram ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :<br />1. Punya akses internet<br />2. Harus punya aplikasi Telegram<br />3. Punya ISO Centos 7<br />4. Sudah terinstall virtualbox<br /><br />Kulgram ini diselenggarakan pada :<br /><strong>Selasa 26 September 2017 pukul 20.00 - selesai</strong><br /><br />Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://docs.google.com/forms/d/e/1FAIpQLScPCJsJJp3DrTTlTEvt4mfRsDO_QhVritQxqSX8sG-gcq637w/viewform?usp=sf_link\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR KULGRAM CENTOS WEB PANEL</a><br /><br />&nbsp;</h2>', 'centos, kulgram, linux, server', '2017-09-11 06:51:49', '2017-09-11 06:52:34'),
(13, 1, 'webinarcilsybw', 'halaman resmi webinar bandwidth mikrotik', 'Webinar GRATIS Studi Kasus Manajemen Bandwidth Queue Tree di Mikrotik', '<p>Webinar ini akan membahas beberapa studi kasus implementasi bandwidth manajemen menggunakan Queue Tree di Mikrotik. Nanti akan ditunjukkan juga bagaimana cara-cara konfigurasinya. Webinar ini akan dibawakan oleh mas Eka Saeful - Founder Padepokan IT dan diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet.<br /><br />Rekan-rekan bisa hanya menonton saja webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :<br />1. Memiliki routerboard versi apa saja.<br />2. Menginstall Mikrotik di virtualbox bagi yang tidak punya<br />3. Koneksi internet.<br /><br />Webinar ini diselenggarakan pada :<br /><br /><strong>24 September 2017 pukul 20.00 - selesai</strong><br /><br />Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"http://www.anymeeting.com/PIID=ED52DD82884739\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WEBINAR MANAJEMEN BANDWIDTH MIKROTIK</a><br /><br />&nbsp;<br /><br /></h2>', 'mikrotik, webinar, jaringan, queue', '2017-09-11 07:06:48', '2017-09-11 07:06:48'),
(14, 1, 'kulgramcilsycwp2', 'halaman resmi kulgram centos web panel bagian 2', 'Kulgram GRATIS Membangun Server Hosting dengan Centos Web Panel Bagian 2', '<p style=\"text-align: center;\"><img src=\"https://1.bp.blogspot.com/-0PMupdHtCGM/Wdxhy8Vb7wI/AAAAAAAAJws/4KNY-Qh8-Skr9F7Ua1xCdYN2pJV0pDVMQCLcBGAs/s320/Kulgram.png\" alt=\"\" width=\"320\" height=\"320\" /></p>\r\n<p>Kulgram atau Kuliah di Telegram kali ini akan membahas tentang lanjutan dari Centos Web Panel. Sebelumnya kita sudah melakukan instalasi CWP ini di kulgram yang pertama, nah disini kita akan melanjutkan materi-materi apa yang bisa dioprek setelah instalasi tersebut.</p>\r\n<p>Kulgram ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet dan menginstall aplikasi Telegram. Yang akan menjadi pembicara adalah mas Taufik Mulyana founder dari blog Nothinux.<br /> Rekan-rekan bisa hanya duduk manis mengikuti kulgram ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet<br /> 2. Harus punya aplikasi Telegram<br /> 3. Punya ISO Centos 7<br /> 4. Sudah terinstall virtualbox</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Jumat 13 Oktober 2017 pukul 20.00 - selesai</strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://docs.google.com/forms/d/1vzDgBvvfWMRJS9dIvIBAXj5bLpzg0VZEX3e-X4UL5T4\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR KULGRAM CENTOS WEB PANEL BAGIAN 2</a><br /><br /></h2>', 'centos, kulgram, linux, server', '2017-10-10 05:46:21', '2017-10-10 06:04:13'),
(15, 1, 'kulgramcilsykripto', 'halaman resmi kulgram kriptografi dasar', 'Kulgram GRATIS Kriptografi Dasar dan Pengaplikasiannya', '<p style=\"text-align: center;\"><img src=\"https://3.bp.blogspot.com/-R01KppuyRH0/WdxlBkAZP1I/AAAAAAAAJxI/ROKuqhO07HU3hdHkAwhWvVIglmn5L7xXwCLcBGAs/s320/Kulgram%2B5th.png\" width=\"320\" height=\"320\" /></p>\r\n<p>Kulgram atau Kuliah di Telegram kali ini akan membahas tentang Kriptografi. Akan dijelaskan benar-benar dari awal apa sih itu Kriptografi, konsep-konsepnya, untuk apa penggunaannya, dan bagaimana pengaplikasiannya.</p>\r\n<p>Kulgram ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet dan menginstall aplikasi Telegram. Yang akan menjadi pembicara adalah mas Ibnu Batutan Zariza, seorang Kriptografer enthusiast dan penulis batutahibnu17.wordpress.com.</p>\r\n<p>Rekan-rekan bisa hanya duduk manis mengikuti kulgram ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet<br /> 2. Harus punya aplikasi Telegram<br /> 3. Sudah terinstall Cryptool 1 (www.cryptool.org)</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Rabu 11 Oktober 2017 pukul 20.00 - selesai</strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://docs.google.com/forms/d/1XPMC6zY9VQKybp9fqOPiFIWYsAyG0MNbxH5zbnyFfAA\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR KULGRAM KRIPTOGRAFI DASAR</a><br /><br /></h2>', 'kulgram, telegram, kriptografi', '2017-10-10 06:18:32', '2017-10-10 06:26:47'),
(16, 1, 'kulgramcilsyapt', 'halaman resmi kulgram apt hemat kuota', 'Kulgram GRATIS Pengaturan apt-get agar Hemat Kuota di Ubuntu', '<p style=\"text-align: center;\"><img src=\"https://3.bp.blogspot.com/-Pyhg6PuHhRw/Wdxhy7iShbI/AAAAAAAAJww/SFjTJWWfDbcZDWI-jEpYCyR1xs3ndENKACLcBGAs/s320/Kulgram%2B4rd.png\" width=\"320\" height=\"320\" /></p>\r\n<p>Kulgram atau Kuliah di Telegram kali ini akan membahas tentang bagaimana mengatur apt-get di Ubuntu agar tidak menyedot bandwidth komputer anda. Karena sebenarnya sadar tidak sadar, ada sesuatu pada apt-get ini yang ternyata melakukan pengunduhan file-file yang tidak terlalu perlu.</p>\r\n<p>Kulgram ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet dan menginstall aplikasi Telegram. Yang akan menjadi pembicara adalah mas Ade Malsasa Akbar founder dari Teknoplasma dan penulis di Linuxku.com.</p>\r\n<p>Rekan-rekan bisa hanya duduk manis mengikuti kulgram ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet<br /> 2. Harus punya aplikasi Telegram<br /> 3. Laptop sudah terinstall Ubuntu Desktop</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Kamis 12 Oktober 2017 pukul 13.00 - 15.00<br /></strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://docs.google.com/forms/d/1K60gpzcEt2yCWdvR7aqCdhzyBdrIjmT8CSqAprOSflA\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR KULGRAM PENGATURAN APT HEMAT KUOTA</a><br /><br /></h2>', 'kulgram, telegram, ubuntu, apt', '2017-10-10 06:25:33', '2017-10-10 06:25:33'),
(17, 1, 'webinarcilsysubnet', 'halaman resmi webinar subnetting cisco', 'Webinar GRATIS Pengaplikasian Subnetting di Cisco Packet Tracer', '<p style=\"text-align: center;\"><img src=\"https://2.bp.blogspot.com/-Q0cBf7Xrm9g/Wdxh0D6ZIeI/AAAAAAAAJw4/qJxwRDtntyE1C_TGEGaMZ7F_3E2bJsqmACLcBGAs/s320/Subnetting.png\" width=\"320\" height=\"320\" /></p>\r\n<p>Webinar atau Workshop Online GRATIS kali ini akan membahas tentang apa itu subnetting dan bagaimana penerapan langsungnya menggunakan cisco packet tracer. Cocok untuk kalian yang baru mau belajar apa itu subnetting.</p>\r\n<p>Webinar ini diadakan SECARA ONLINE sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet stabil dan Firefox/Chrome. Yang akan menjadi pembicara adalah mas Tresna Widiyaman founder dari Warriormux dan trainer di Cilsy.</p>\r\n<p>Rekan-rekan bisa tinggal duduk manis mengikuti webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet stabil.<br /> 2. Harus punya Firefox/Chrome <br /> 3. Laptop sudah terinstall Cisco Packet Tracer</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Senin 16 Oktober 2017 pukul 20.00 - selesai<br /></strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"http://www.anymeeting.com/PIID=ED52D983814D3E\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WEBINAR SUBNETTING PACKET TRACER</a><br /><br /></h2>', 'webinar, cisco, subnetting', '2017-10-10 08:53:53', '2017-10-10 08:53:53'),
(18, 1, 'webinarcilsydhcp', 'halaman resmi webinar mikrotik dhcp', 'Webinar GRATIS Pemanfaatan DHCP Server di Mikrotik', '<p style=\"text-align: center;\"><img src=\"https://4.bp.blogspot.com/-gK5sKf5D_Dg/Wdxh0ST32AI/AAAAAAAAJw8/xaFtFU1DACAtxv5DiMWXRo2WoSs0fRy4QCLcBGAs/s320/dhcp.png\" width=\"320\" height=\"320\" /></p>\r\n<p>Webinar atau Workshop Online GRATIS kali ini akan membahas tentang apa itu DHCP dan bagaimana pemanfaatan DHCP di Mikrotik. Cocok untuk kalian yang baru mau belajar apa itu konsep DHCP.</p>\r\n<p>Webinar ini diadakan SECARA ONLINE sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet stabil dan Firefox/Chrome. Yang akan menjadi pembicara adalah mas Eka Saeful founder dan trainer di Padepokan IT.</p>\r\n<p>Rekan-rekan bisa tinggal duduk manis mengikuti webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet stabil.<br /> 2. Harus punya Firefox/Chrome <br /> 3. Virtualbox dan ISO Mikrotik/Routerboard seri apa saja</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Minggu 29 Oktober 2017 pukul 20.00 - selesai<br /></strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"http://www.anymeeting.com/PIID=ED52D88383483A\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WEBINAR PEMANFAATAN DHCP MIKROTIK</a><br /><br /></h2>', 'webinar, mikrotik, jaringan, dhcp', '2017-10-10 09:02:10', '2017-10-18 12:16:37'),
(19, 1, 'downloadebookdockerportainer', 'halaman download ebook docker portainer', 'Download Ebook Docker Portainer dari Dasar', '<p>Untuk mendownload ebook \"Belajar Docker Portainer Dasar\", kalian tinggal lakukan hal ini ya :<br /><br />1. Silahkan tambahkan nomor whatsapp <strong>089630713487</strong> (Beri nama kontaknya bebas, boleh Cilsy saja). Jika kalian sudah pernah menambahkan nomor tersebut, boleh langsung lompat ke langkah dibawah.<br />2. Kirim pesan pribadi ke nomor whatsapp tersebut yang berisi : <strong>DOWNLOAD EBOOK BELAJAR DOCKER PORTAINER DASAR</strong><br /><br />Nanti kalian akan dibalas oleh tim Cilsy link untuk mendownload ebooknya.<br /><br />Oiya, asiknya lagi kalian akan dapat bonus info-info penting dan menarik seputar dunia IT, jaringan, server hingga IoT tiap minggunya dari nomor tersebut lho. Link-link ebook, webinar, workshop dan tutorial-tutorial eksklusif juga bakal sering kita bagikan disana.<br /><br />Salam!</p>', 'ebook, download, linux, docker, portainer', '2017-10-16 07:23:46', '2017-10-16 07:23:46'),
(20, 1, 'webinarcilsyinkwajah', 'halaman resmi webinar inkscape vektor wajah', 'Webinar GRATIS Membuat Vektor Wajah dengan Inkscape', '<p style=\"text-align: center;\"><img src=\"https://4.bp.blogspot.com/-rAAeNP8jvpc/WgqucJIwqTI/AAAAAAAAJ3Q/7w6okKFpsect_9asWK5ZTusVm0gGdocbACLcBGAs/s320/Membuat%2BVektor%2Bwajah%2Bdengan%2BInkscape.png\" width=\"320\" height=\"320\" /></p>\r\n<p>Webinar atau Workshop Online GRATIS kali ini akan bertemakan desain menggunakan Inkscape. Kalian disini langsung akan mempraktekkan bagaimana caranya membuat vektor wajah sendiri menggunakan tools desain open source Inkscape.</p>\r\n<p>Webinar ini diadakan SECARA ONLINE sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet stabil dan Firefox/Chrome. Yang akan menjadi pembicara adalah mas Tresna Widiyaman - Founder dari Warriornux dan Trainer di Cilsy.</p>\r\n<p>Rekan-rekan bisa tinggal duduk manis mengikuti webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet stabil.<br /> 2. Harus punya Firefox/Chrome <br /> 3. Punya laptop sendiri yang sudah terinstall software Inkscape</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Rabu 15 November pukul 20.00 - selesai<br /></strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"http://www.anymeeting.com/PIID=ED53DF87844C3A\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WEBINAR INKSCAPE VEKTOR WAJAH</a><br /><br /></h2>', 'webinar, inkscape, desain', '2017-11-14 09:00:12', '2017-11-14 09:00:12'),
(21, 1, 'webinarcilsyucarp', 'halaman resmi webinar falover backup server ucarp', 'Webinar GRATIS Implementasi Failover Backup Server menggunakan Ucarp', '<p style=\"text-align: center;\"><img src=\"https://3.bp.blogspot.com/-uBxKd9YqfTo/WgquatqYM1I/AAAAAAAAJ3E/pchtHyJ9QLoOldERnQX6jP-t7Bo3z_C-ACLcBGAs/s320/Implementasi%2Bdan%2BPengenalan%2BFailover.png\" width=\"320\" height=\"320\" /></p>\r\n<p>Webinar atau Workshop Online GRATIS kali ini akan membahas tentang bagaimana caranya membuat sebuah sistem backup server secara Fail Over menggunakan Ucarp. Sangat cocok untuk diikuti oleh para sysadmin pemula yang kebingungan ketika tiba-tiba server down tapi tidak ada sistem penggantinya secara otomatis.</p>\r\n<p>Webinar ini diadakan SECARA ONLINE sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet stabil dan Firefox/Chrome. Yang akan menjadi pembicara adalah mas Raafi Ramadhan, seorang Linux Enthusiast dan juga Sysadmin di PT. Terakorp Indonesia.</p>\r\n<p>Rekan-rekan bisa tinggal duduk manis mengikuti webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet stabil.<br /> 2. Harus punya Firefox/Chrome <br /> 3. Virtualbox dan ISO Ubuntu Server 14.04<br />4. Sudah diinstall 2 buah Ubuntu Server di Virtualboxnya yang saling terkoneksi satu sama lain (bisa saling ping) dan sudah terkoneksi ke internet.</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Sabtu 25 November 2017 pukul 20.00 - selesai<br /></strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"http://www.anymeeting.com/PIID=ED53DF87844C3D\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WEBINAR FAILOVER BACKUP SERVER UCARP</a><br /><br /></h2>', 'webinar, server, ubuntu, linux, ucarp', '2017-11-14 09:28:04', '2017-11-14 09:28:04'),
(22, 1, 'webinarcilsyvap', 'halaman resmi webinar wireless station virtual ap mikrotik', 'Webinar GRATIS Implementasi Wireless Station dan Virtual AP di Mikrotik', '<p style=\"text-align: center;\"><img src=\"https://4.bp.blogspot.com/-vL7n3syLfUQ/WgqubSMBKiI/AAAAAAAAJ3I/BrENWaug_rouDoF8io4md0tow0dH4k1CACLcBGAs/s320/Implementasi%2BWireless%2BStation%2Bdan%2BVirtual%2BAO.png\" width=\"320\" height=\"320\" /></p>\r\n<p>Webinar atau Workshop Online GRATIS kali ini akan membahas tentang bagaimana caranya mengimplementasikan Wireless Station dan Virtual AP di Mikrotik. Yaitu teknik di mikrotik dimana walaupun interface wireless yang dimiliki hanya satu, tapi bisa membuat banyak SSID (seakan-akan banyak AP). </p>\r\n<p>Webinar ini diadakan SECARA ONLINE sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet stabil dan Firefox/Chrome. Yang akan menjadi pembicara adalah mas Eka Saeful founder dan trainer di Padepokan IT.</p>\r\n<p>Rekan-rekan bisa tinggal duduk manis mengikuti webinar ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet stabil.<br /> 2. Harus punya Firefox/Chrome <br /> 3. 2 BUAH Routerboard seri yang memiliki interface Wireless (RB 941/rb951/rb433)</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Minggu 26 November 2017 pukul 20.00 - selesai<br /></strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"http://www.anymeeting.com/PIID=ED53DF87844C3C\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR WEBINAR VIRTUAL AP DI MIKROTIK</a></h2>', 'mikrotik, webinar, jaringan, virtual ap, wireless', '2017-11-14 09:36:00', '2017-11-14 09:36:00'),
(23, 1, 'kulgramcilsysql', 'halaman resmi kulgram teknik sql injection', 'Kulgram GRATIS Belajar Teknik Hacking SQL Injection', '<p style=\"text-align: center;\"><img src=\"https://4.bp.blogspot.com/-zjQ2Zk_cD7g/WgqubU8kYyI/AAAAAAAAJ3M/ldQIZBzmtYArb1_gcxct4S7g6IAd9opsACLcBGAs/s320/Kulgram%2BTeknik%2BHacking.png\" width=\"320\" height=\"320\" /></p>\r\n<p>Kulgram atau Kuliah di Telegram kali ini akan membahas tentang bagaimana teknik hacking sql injection bisa terjadi, kenapa bisa terjadi, dan bagaimana cara mengatasinya. Ikuti materi ini agar kalian mendapatkan ilmu dasar bagaimana memproteksi website kalian agar tidak terkena hack oleh teknik yang satu ini.</p>\r\n<p>Kulgram ini diadakan secara online sehingga dapat rekan-rekan ikuti dari rumah masing-masing asal ada internet dan menginstall aplikasi Telegram. Yang akan menjadi pembicara adalah mas Ibnu Batutah Zarizal, seorang Criptographer enthusiast, dan penulis blog batutahibnu17.wordpress.com.</p>\r\n<p>Rekan-rekan bisa hanya duduk manis mengikuti kulgram ini. Tapi kalau mau ikut praktek langsung, silahkan disiapkan requirement berikut :</p>\r\n<p>1. Punya akses internet<br /> 2. Harus punya aplikasi Telegram<br /> 3. Laptop Windows untuk praktek.</p>\r\n<p>Kulgram ini diselenggarakan pada :<br /> <strong>Kamis 16 November 2017 pukul 19.30 - selesai.<br /></strong></p>\r\n<p>Untuk pendaftaran silahkan klik tombol berikut :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://docs.google.com/forms/d/1EFG3o7Uje_82mqVGxZooiA_sBNkcUL9S80qMgu5k89I\" target=\"_blank\" rel=\"noopener noreferrer\">DAFTAR KULGRAM TEKNIK HACKING SQL INJECTION</a><br /><br /></h2>', 'kulgram, telegram, sql injection, hacking', '2017-11-14 09:47:41', '2017-11-14 09:47:41'),
(24, 1, 'faq', 'halaman faq', 'Frequently Asked Questions', '<p>Dibawah ini adalah pertanyaan-pertanyaan yang sering ditanyakan oleh para pengguna. Tekan CTRL + F untuk mencari kata kunci pertanyaan yang anda mau.</p>\r\n<p><strong>T : Berapa harga untuk kursus online di cilsy?</strong><br clear=\"none\" />J : Harganya ada di kisaran Rp. 119.000 - Rp. 499.000 tergantung paket langganan yang anda pilih. Untuk melihat perbedaan antar paket bisa lihat link ini : <a href=\"../../../pages/harga\" target=\"_blank\" rel=\"noopener noreferrer\">Lihat Perbedaan antar paket</a></p>\r\n<p><strong>T : Apa perbedaan paket Pro, Premium dan Platinum?<br /></strong>J : Perbedaan utama dari 3 paket tersebut adalah dari segi durasi dan fasilitas yang didapatkan. Paket yang paling lengkap fasilitasnya dan paling hemat adalah paket PLATINUM dengan masa aktif 6 bulan, bisa download video, ebook, serta dapat support remote teamviewer. Untuk melihat perbedaan antar paket lebih jelas bisa lihat link ini : <a href=\"../../../pages/harga\" target=\"_blank\" rel=\"noopener noreferrer\">Lihat Perbedaan antar paket</a></p>\r\n<p><strong>T : Apakah kursus online ini cocok untuk pemula ?</strong><br />J : Sangat cocok. Karena materi-materi disini dibuat bertahap mulai dari dasar sampai mahir. &nbsp;</p>\r\n<p><strong>T : Apakah saya dapat semua tutorial di semua kategori ketika sudah berlangganan?<br /></strong>J : Betul. Di Cilsy sistemnya bukan beli per judul/materi tutorial. Tapi cukup 1x bayar berlangganan itu sudah dapat semua materi tutorial.</p>\r\n<p><strong>T : Bagaimana sistem belajar di cilsy ini?<br /></strong>J : Belajar di Cilsy sangat mudah. Anda tinggal pilih judul materi yang anda mau -&gt; tonton dan praktekkan materi dari video tutorial yang kami sediakan -&gt; kalau kesulitan/bingung bisa nanya ke trainer Cilsy via chat di web cilsy langsung/whatsapp.</p>\r\n<p><strong>T : Apakah ada jaminan saya akan dipandu sampai bisa?<br /></strong>J : Ada, tim kami akan selalu siap memandu dan menjawab semua pertanyaan anda selama proses belajar anda di Cilsy.</p>\r\n<div><strong>T : Apakah saya bisa mendownload semua video yang ada disini?<br /></strong>J : Bisa. Tapi fitur untuk download semua video hanya untuk member paket PREMIUM dan PLATINUM.</div>\r\n<div><strong>T : Apakah ada materi bentuk ebooknya?<br /></strong>J : Saat ini sekitar 40% materi yang ada di Cilsy sudah tersedia bentuk ebooknya. Dan kami akan terus tambahkan hingga 100%. Untuk yang bisa mendownload materi ebook hanya member paket PREMIUM dan PLATINUM.</div>\r\n<div>\r\n<div><strong>T : Apakah ada grup diskusi bersama member lain?<br /></strong>J : Ada, kita punya grup diskusi di telegram. Nanti bisa anda tanyakan ke tim kami melalui chat/whatsapp/email untuk link join grupnya.</div>\r\n<div><strong>T : Apakah saya bisa request materi saya sendiri?<br /></strong>J : Bisa. Silahkan sampaikan ke tim kami melalui chat/whatsapp/email dan kami akan segera buatkan materinya.</div>\r\n</div>\r\n<div><strong>T : Bagaimana cara saya pesan semua materi tutorialnya/daftar kursus onlinenya?</strong></div>\r\n<div>J : Anda cukup melakukan 4 tahap berikut :</div>\r\n<div>1. Klik tombol daftar di pojok kanan atas<br />2. Pilih paket langganan yang anda mau<br />3. Pilih metode pembayaran &amp; bayar sesuai petunjuk<br />4. Login akun dan mulai akses semua tutorial</div>\r\n<div>Atau kalau masih bingung bisa lihat halaman ini : <a href=\"https://cilsy.id/pages/carapesan\" target=\"_blank\" rel=\"noopener noreferrer\">Detil Cara Pesan</a></div>\r\n<p><br clear=\"none\" /><strong>T : Metode apa saja yang digunakan untuk pembayaran paket langganan?<br /></strong>J : Saat ini Anda bisa membayar via kartu kredit dan bank transfer. Untuk bayar via bank transfer, saat ini nomor rekening kami hanya tersedia untuk Bank Permata dan Bank Mandiri. Sehingga apabila anda menggunakan bank selain itu maka akan ada tambahan biaya transfer beda bank.<br clear=\"none\" /><br clear=\"none\" /><strong>T : Jika saya sudah membayar, apakah saya perlu konfirmasi pembayaran saya?<br /></strong>J : Tidak perlu. Sistem kami bisa mendeteksi secara otomatis pembayaran anda.<br clear=\"none\" /><br clear=\"none\" /><strong>T : Bagaimana cara saya bisa konsultasi dengan trainer?<br /></strong>J : Bisa melalui chat yang ada di web cilsy, via email ke <a href=\"mailto:support@cilsy.id,\">support@cilsy.id,</a> maupun via whatsapp ke 089630713487.<br clear=\"none\" /><br clear=\"none\" /><strong>T : Bagaimana cara saya bisa minta support remote teamviewer?<br /></strong>J : Anda bisa langsung minta ke tim trainer kami via chat/whatsapp/email dengan menyebutkan kebutuhan anda dan kapan tanggal serta jam anda mau minta di remote. Fasilitas ini hanya untuk member paket PLATINUM.</p>\r\n<p><strong>T : Bagaimana cara saya memperpanjang paket langganan?<br /></strong>J : Anda cukup melakukan 4 tahap berikut :<br />1. Login ke cilsy.id, klik nama anda di pojok kanan atas, lalu klik Perpanjang.<br />2. Pilih paket langganan yang anda mau<br />3. Pilih metode pembayaran &amp; bayar sesuai petunjuk<br />4. Login akun dan mulai akses semua tutorial</p>\r\n<div>\r\n<p>Tidak menemukan pertanyaan anda? Sampaikan pertanyaan anda via chat di web ini atau whatsapp ke 089630713487 atau email ke <a href=\"mailto:support@cilsy.id\">support@cilsy.id</a>.</p>\r\n</div>', 'faq', '2017-11-20 06:16:12', '2017-11-26 00:12:16'),
(25, 1, 'carapesan', 'halaman cara pesan', 'Cara Pesan Paket Langganan Cilsy', '<p>Ikuti 5 langkah mudah dibawah ini untuk pesan paket langganan di Cilsy :)</p>\r\n<p style=\"text-align: center;\"><img src=\"https://4.bp.blogspot.com/-SPiS1-AUEPU/WhoQr8co5lI/AAAAAAAAJ4c/Kxy21GV91Ew6MPc-mt8g0fj6w4Zoo4ryQCLcBGAs/s1600/cara%2Bpesan.png\" alt=\"\" width=\"744\" height=\"1052\" /></p>\r\n<p style=\"text-align: left;\">Sudah mengerti? Yuk pesan sekarang dengan klik tombol dibawah ini :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://cilsy.id/member/signup\" target=\"_blank\" rel=\"noopener noreferrer\">Daftar dan Pesan Paket Cilsy</a></h2>\r\n<p style=\"text-align: left;\">Masih mengalami kesulitan? Bisa langsung chat tim kami melalui chat di web ini atau whatsapp ke 089630713487.</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>', 'pesan', '2017-11-20 06:17:35', '2017-11-26 01:13:24'),
(26, 1, 'petunjukcarabayar', 'halaman petunjuk cara bayar', 'Petunjuk Cara Bayar', '<p>Kebingungan dengan cara membayar paket langganan di Cilsy? Kami coba buatkan petunjuk sederhananya dibawah ini :</p>\r\n<p style=\"text-align: center;\"><img src=\"https://4.bp.blogspot.com/-tISNN0HI2oA/WhpacqdRhCI/AAAAAAAAJ5Q/kf8uBTaIqKkXxsJpGpuHqRKqnhG3NBz-ACLcBGAs/s1600/petunjuk%2Bbayar.png\" alt=\"\" width=\"744\" height=\"1052\" /></p>\r\n<p style=\"text-align: justify;\">Masih bingung? Anda bisa langsung tanyakan pada tim kami melalui chat di website ini/Whatsapp ke 089630713487 atau email ke <a href=\"mailto:support@cilsy.id\">support@cilsy.id.</a></p>\r\n<p style=\"text-align: justify;\">Belum daftar di Cilsy.id dan belum tau cara pesan paket langganannya? Klik tombol dibawah ini :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://cilsy.id/member/signup\" target=\"_blank\" rel=\"noopener noreferrer\">Daftar dan Pesan Paket Cilsy</a></h2>\r\n<p>&nbsp;</p>', 'cara bayar', '2017-11-24 07:52:16', '2017-11-26 06:16:42'),
(27, 1, 'harga', 'halaman harga', 'Harga & Perbedaan Paket Langganan Cilsy', '<p>Cilsy menyediakan 3 pilihan paket langganan untuk anda yang bisa anda sesuaikan dengan budget dan fitur yang anda butuhkan.</p>\r\n<p>Kabar baiknya, khusus bagi anda yang pesan sebelum tanggal 5 Desember 2017, anda bisa dapatkan potongan harga 10% untuk paket PREMIUM dan PLATINUM + Bonus Ebook Eksklusif Membangun server VOIP dengan Asterisk.</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://cilsy.id/member/signup\" target=\"_blank\" rel=\"noopener noreferrer\">Daftar dan Pesan Paket Cilsy Sekarang</a></h2>\r\n<p>Lihat harga dan perbandingan paket dibawah ini :</p>\r\n<p style=\"text-align: center;\"><img src=\"https://2.bp.blogspot.com/-Sx8r9_L31SI/WhobiIvDnAI/AAAAAAAAJ5A/1qcxfO-TMzsaDRSiuT8HYDqEAGaWIABXgCLcBGAs/s1600/pricing.png\" alt=\"\" width=\"960\" height=\"625\" /></p>\r\n<p style=\"text-align: left;\">Tertarik? Daftar dan pesan sekarang juga dengan klik tombol dibawah :</p>\r\n<h2 style=\"text-align: center;\"><a href=\"https://cilsy.id/member/signup\" target=\"_blank\" rel=\"noopener noreferrer\">Daftar dan Pesan Paket Cilsy Sekarang</a></h2>\r\n<p>&nbsp;</p>', 'harga', '2017-11-25 23:02:00', '2017-11-26 01:48:51'),
(28, 1, 'fiturdownloadbaru', 'halaman pemberitahuan rilis fitur download video cilsy', 'Rilis Fitur tombol Download dan Next Previous', '<p>Kabar gembira untuk Anda para pengguna paket PREMIUM dan PLATINUM di Cilsy! Kini anda bisa langsung download video tanpa harus menggunakan software tambahan. Kami sudah sediakan tombol downloadnya, tinggal klik dan mulai mendownload!</p>\r\n<p>Bagaimana caranya? Simak langkah dibawah :</p>\r\n<p>1. Pada saat anda masuk ke halaman salah satu tutorial, anda bisa <strong>scroll kebawah.</strong></p>\r\n<p><strong><img src=\"https://1.bp.blogspot.com/-UWaK3-b1RSw/WiqTkZzbcjI/AAAAAAAAJ7g/9to-h3Gjs6MebfUzqAy4XXOm71RlQNKDACLcBGAs/s400/image%2B300.png\" /></strong></p>\r\n<p>2. Setelah itu klik tombol menu <strong>Daftar Materi</strong> lalu tinggal klik tombol <strong>Download</strong> yang disediakan pada masing-masing judul materi (lihat yang di highlight kuning dibawah ini).</p>\r\n<p><img src=\"https://3.bp.blogspot.com/-OSMWvKGoqCs/WiqTj-mIprI/AAAAAAAAJ7Y/5R5fc4YasaEKTL5Oj4ZJ_8Y6zRoYHdyswCLcBGAs/s400/Image%2B301.png\" alt=\"\" width=\"400\" height=\"225\" /></p>\r\n<p><strong>Mudah bukan?</strong></p>\r\n<p>Dan satu lagi fitur terbaru yang kita rilis adalah anda sekarang bisa lompat ke video berikutnya atau sebelumnya dengan lebih mudah. Karena kami sekarang sudah sediakan tombol <strong>Next Video</strong> dan <strong>Previous Video</strong>. Caranya? Lihat gambar dibawah ya :</p>\r\n<p><img src=\"https://4.bp.blogspot.com/-WywvFpC81Js/WiqTkFxXwbI/AAAAAAAAJ7c/GUpghTZ6vjEdMD8PKn-yB_JnXkLIXzmhQCLcBGAs/s400/Image%2B302.png\" alt=\"\" width=\"400\" height=\"232\" /></p>\r\n<p>Semoga dengan dirilisnya 2 fitur baru ini, dapat lebih memudahkan anda dalam menggunakan layanan Cilsy.</p>\r\n<p>Selamat belajar!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'fitur baru, tombol download', '2017-12-08 13:37:17', '2017-12-08 13:39:49'),
(29, 1, 'downloadebookasterisk', 'halaman download ebook asterisk', 'Download Ebook Eksklusif Membangun Server VoIP dengan Asterisk', '<p>Mau download ebook super keren dibawah ini?</p>\r\n<p style=\"text-align: center;\"><img src=\"https://4.bp.blogspot.com/-gUrkNQIdpUA/WhuSeqbckkI/AAAAAAAAJ5s/Ep3IVT8JK34ge79o11EYdLFqMvPV24-DQCLcBGAs/s320/cover%2Bebook%2Bvoip%2Basterisk.png\" alt=\"\" width=\"242\" height=\"320\" /></p>\r\n<p>Sayangnya ebook ini eksklusif <strong>hanya untuk member cilsy yang membayar/perpanjang pada periode 26 November - 5 Desember 2017 saja.</strong></p>\r\n<p>Bagi anda yang <strong>merasa</strong> sudah membayar/perpanjang pada periode tersebut, silahkan lakukan hal berikut untuk bisa mendapatkan link download ebooknya :</p>\r\n<p>1. Add kontak whatsapp Cilsy di 089630713487.<br />2. Kirim pesan Whatsapp ke kontak tersebut yang berisi :<br /><strong>Email anda :</strong><br /><strong>Tanggal bayar : </strong><br /><strong>Request : Download ebook voip asterisk</strong></p>\r\n<p>Contoh seperti ini :<br /><strong>Email anda : rizal@cilsy.id</strong><br /><strong>Tanggal bayar : 29 November 2017</strong><br /><strong>Request : Download ebook voip asterisk</strong></p>\r\n<p>Nanti akan kami berikan link downloadnya kepada anda. Ditunggu saja ya!</p>\r\n<p>Nah, buat anda yang belum berlangganan tapi juga mau mendapatkan ebook ini, kami beri kesempatan untuk anda agar segera memesan <strong>MAX sampai 13 Desember 2017 pukul 23.59</strong>. Kami beri batas kuota hanya untuk <strong>30 orang saja</strong>.</p>\r\n<p>Bingung cara pesannya?</p>\r\n<h2 style=\"text-align: center;\"><a href=\"../carapesan\" target=\"_blank\" rel=\"noopener noreferrer\">Lihat Cara Pesan</a></h2>\r\n<p>&nbsp;</p>', 'download, ebook, linux, asterisk, voip', '2017-12-09 14:03:46', '2017-12-09 14:27:55');
